import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import cardStuff from './cards.jsx';
import {Button, Card, Container, Col, Row, CardColumns, } from 'react-bootstrap'


function App() {
  return (
    <div className="App">
    <header className='App-header'>


      <Button1/>
      <Cards /> 

    </header>

    </div> 
  );
}

function Button1() {
  return (
  <div>
  <Button>Did this work Scott???</Button>
  </div>
  );
}

function Cards() {
  return (
  <div>

   <Card className='mb-3' style={{ color: "#000" }}>

      <Card.Body>

      <Card.Title>About</Card.Title>          
       </Card.Body>


  </Card>

  <Card className='mb-3' style={{ color: "#000" }}>

   <Card.Body>

      <Card.Title>
            About
      </Card.Title>          
      </Card.Body>

    </Card>

  </div>
  );
}
export default App;
